import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <h1 className="Head">Pomodoro</h1>
      <div className="Session">
      <div className="Break">
      <h1>Break</h1>
      <div className="timesetter">
      <span>-</span>
      <p>5</p>
      <span>+</span>
      </div>
      </div>
      <div className="Working">
      <h1>Session</h1>
      <div className="timesetter">
      <span>-</span>
      <p>30</p>
      <span>+</span>
      </div>
      </div>
      </div>
      </div>
    );
  }
}

export default App;
